Promotional info from Comic Vine - &quot;SUPERMAN: THE WORLD OF KRYPTON chronicles key events in the history of Superman's birth planet. Among the events are a war that raged for 1,000 years and a conspiracy to destroy the planet that was thwarted by Superman's birth father, Jor-El. This volume also includes several classic tales of Krypton that served as inspiration for modern stories of that doomed world. 
This series is one in a trilogy of Post-Crisis Superman origin mini-series from John Byrne, including World of Smallville and World of Metropolis. &quot;

This is all four issues of the series in scans by Minutemen-KangCouncil. Thanks for their efforts; please seed and enjoy. 

